import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Header.css'; // Import the CSS file

const Header = ({ user }) => {
  const navigate = useNavigate();

  const openProfilePage = () => {
    if (user === 'student') {
      navigate('/profile/student');
    } else if (user === 'coordinator') {
      navigate('/profile/coordinator');
    }
  };

  return (
    <header className="header">
      <div className="logo-container">
        <img src="logo.png" alt="College Logo" className="logo" />
        <span className="college-name">Shri Vishnu Engineering College for Women</span>
      </div>
      <button onClick={openProfilePage} className="profile-button">
        Profile
      </button>
    </header>
  );
};

export default Header;
